import React,{useState,useEffect} from "react";
import "./Gallery.css";


function Gallery() {

  const [images, setImages] = useState([])
  useEffect(() => {
  const fetchImages=()=>{
    const data=[
      {
        id:1,
        url:'data:image/jpeg;base64,',
        title:'Image 1',
      },
      {
        id:2,
        url:'data:image/jpeg;base64,',
        title:'Image 2',
      },
      {
        id:3,
        url:'data:image/jpeg;base64,',
        title:'Image 3',
      },
      {
        id:4,
        url:'data:image/jpeg;base64,',
        title:'Image 4',
      },
      {
        id:5,
        url:'data:image/jpeg;base64,',
        title:'Image 5',
      }
    ]
    setImages(data)
    
  }
  fetchImages()
  }, [])
  
 const handleDeleteImage=(idImage)=>{
   setImages(images.filter((img)=>img.id !== idImage))
 }

  return (

    <div>

      <h1 className="title">Image Gallery App</h1>
   {
    images.length>0?
    (<div className="img-grid">

    {
      images.map((img)=>(
        <div className="img-card" key={img.id}>
           <img src={img.url} alt="no screening" />
        <div className="img-details">

          <h3>{img.title}</h3>
          <button onClick={()=>handleDeleteImage(img.id)}>Delete</button>
        </div>
      </div>
      ))
          
    }

 
  </div>):
  <p className="noImg">No Images in this Gallery</p>
   }
     
    </div>
  );
}

export default Gallery;
